// src/components/FilterCheckboxes.js
import React from "react";

const FilterCheckboxesActor = ({ filters, onFilterChange }) => {
  return (
    <div class="carousel-container" id="containerActor">
      <div id="carouselActor" class="carousel">
        {filters.map((filter) => (
          <div class="carousel-item" key={filter}>
            <label>
              <input
                type="checkbox"
                value={filter}
                onChange={(e) => onFilterChange(filter, e.target.checked)}
              />
              {filter}
            </label>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FilterCheckboxesActor;
